import React, { Fragment } from 'react';
import { FaPen, FaTrash } from "react-icons/fa";
import jwt_decode from 'jwt-decode';

module.exports = {
    initialize({ history }){
        const authorization = localStorage.getItem('61757468');

        if(!authorization){
            history.push('./Login')
        }else{
            let auth_decode = jwt_decode(authorization);

            let obj = [{permission: auth_decode.permission,
                authorization
            }];

            return obj;
        }
    },

    edit(event, id) {
        event.preventDefault();
        console.log(id)
    }, 

    del(event, id) {
        event.preventDefault();
        console.log(id)
    }, 

    returnEditHtml(id){
        const editHtml = <Fragment>
                            <button 
                                onClick={(e) => {this.edit(e, id)}} 
                                type="button" 
                                className="btn btn-warning"><FaPen />
                            </button>
                        </Fragment>

        return editHtml;
    },

    returnDeleteHtml(id){
        const deleteHtml =  <Fragment>
                                <button 
                                    onClick={(e) => {this.del(e, id)}}
                                    type="button" 
                                    className="btn btn-danger"><FaTrash />
                                </button>
                            </Fragment>

        return deleteHtml;
    }
}
